function Performance(){
    const data = [
        {
            value: 80,
            kind: 1
        },
        {
            value: 120,
            kind: 2
        },
        {
            value: 140,
            kind: 3
        },
        {
            value: 50,
            kind: 4
        },
        {
            value: 200,
            kind: 5
        },
        {
            value: 90,
            kind: 6
        }
    ]
    // Rotate radar to start with intensity
    const angleStart = 210

    // Format kind
    const titleKind = {
        cardio: 'Cardio',
        energy: 'Energie',
        endurance: 'Endurance',
        strength: 'Force',
        speed: 'Vitesse',
        intensity: 'Intensité',
    }
    const data1 = [
        {
            "subject": "Math",
            "A": 120,
            "B": 110,
            "fullMark": 150
        },
        {
            "subject": "Chinese",
            "A": 98,
            "B": 130,
            "fullMark": 150
        },
        {
            "subject": "English",
            "A": 86,
            "B": 130,
            "fullMark": 150
        },
        {
            "subject": "Geography",
            "A": 99,
            "B": 100,
            "fullMark": 150
        },
        {
            "subject": "Physics",
            "A": 85,
            "B": 90,
            "fullMark": 150
        },
        {
            "subject": "History",
            "A": 65,
            "B": 85,
            "fullMark": 150
        }
    ]

    return (
        <>
            {/*
                <RadarChart
                    cx="50%"
                    cy="50%"
                    outerRadius="65%"
                    startAngle={angleStart}
                    endAngle={angleStart + 360}
                    data={data}
                >
                    <PolarGrid />
                    <PolarAngleAxis
                        dataKey="kind"

                        tick={{ fill: '#FFFFFF', fontSize: '0.875em'}}
                    />
                    <Radar
                        legendType="none"
                        dataKey="value"
                        stroke="#E60000"
                        fill="#E60000"
                        fillOpacity={0.7}
                    />
                    <Legend />
                </RadarChart>
                */}
        </>
    )
}
export default Performance;
